import React, { useState } from 'react';

const LargeCube = () => {
  const [clickedFaceIndex, setClickedFaceIndex] = useState(null);

  const handleFaceClick = (index) => {
    setClickedFaceIndex(index);
  };

  return (
    <div>
      <h2>Box with Clickable Faces</h2>
      <div className="box">
        {[0, 1, 2, 3].map((index) => (
          <div
            key={index}
            className="face"
            onClick={() => handleFaceClick(index)}
          >
            {`Face ${index}`}
          </div>
        ))}
      </div>
      <p>
        {clickedFaceIndex !== null
          ? `You clicked on Face ${clickedFaceIndex}`
          : 'Click on a face to get its index'}
      </p>
    </div>
  );
};

export default LargeCube;
